import React from 'react';
import styled from 'styled-components';

const TimerContainer=styled.section`
background-position: center;
background-size: cover;
width: 100vw;
height: 100vh;

`;
const Timer=styled.section`
background-color: rgba(0,0,0,0.5);
display: flex;
flex: column;
align-items: center;
justify-content: center;
padding-bottom: 7em;
padding-top: 2em;
width: 100%;
height: 100%;

`;
const Section=styled.section`
border: 1px solid #FEDE17;
border-radius: 3px;
display: grid;
grid-template-columns: repeat(7,1fr);
margin-top: 3em;
padding: ;
`;
const Gap=styled.span``;

const CountDown = () => {
    return (
      <TimerContainer>
          <Timer>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Days
                      </small>
                  </p>
                  <Gap></Gap>
              </Section>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Hours
                      </small>
                  </p>
                  <Gap></Gap>
              </Section>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Minutes
                      </small>
                  </p>
                  <Gap></Gap>
              </Section>
              <Section>
                  <p>
                      87
                  </p>
                  <p>
                      <small>
                          Seconds
                      </small>
                  </p>
              </Section>
          </Timer>
      </TimerContainer>
    )
}

export default CountDown
